          <td >{props.game1LeaderBoardStage[1]}</td>
          <td >{props.game1LeaderBoardTries[1]}</td>
          <td >{props.game1LeaderBoardUsername[1]}</td>
          </tr>
          <tr>
          <td >{props.game1LeaderBoardIndex[1]}</td>
